import { View, Text, TextInput, StyleSheet } from "react-native";
import React from "react";

import Layout from "../components/Layout";

const PersonaFormScreen = () => {
  return (
    <Layout>
      <TextInput
        style={styles.input}
        placeholder="Cedula Estudiante"
      />
      <TextInput
        style={styles.input}
        placeholder="Nombre Estudiante"
      />
      <TextInput
        style={styles.input}
        placeholder="Apellido Estudiante"
      />
      <TextInput
        style={styles.input}
        placeholder="Telefono Estudiante"
      />
      <TextInput
        style={styles.input}
        placeholder="Correo Estudiante"
      />
      <TextInput
        style={styles.input}
        placeholder="Direccion Estudiante"
      />
    </Layout>
    
  );
};

const styles = StyleSheet.create({

  input: {
    width: '90%',
    backgroundColor: '#fff',
    padding: 20,
    marginTop: 30,
    borderWidth: 3,
    borderColor: '#AF8A46'
  }

})

export default PersonaFormScreen;
